can be ordered in a single order. </li>\n</ul>\n\n<p>With these kind of settings we are giving you complete free hand to play with your timings at will. Checkout our <a href=http://food-store.wpscripts.in/knowledge-base/category/premium-store-service-hours/\" target=\"_blank\">Knowledge Base</a> for more details and help with setup. </p>\";s:17:\"short_description\";s:131:\"With Store and Service hours premium extension, you will be getting tons of customizable options to manage your timings like a pro.\";s:10:\"banner_url\";s:61:\"//s3-us-west-2.amazonaws.com/freemius/plugins/6932/banner.png\";s:15:\"card_banner_url\";s:66:\"//s3-us-west-2.amazonaws.com/freemius/plugins/6932/card_banner.png\";s:15:\"selling_point_0\";s:72:\"Setup various service timings for Delivery and Pickup with cutoff times.\";s:15:\"selling_point_1\";s:64:\"Manage your service days with special opening days and holidays.\";s:15:\"selling_point_2\";s:62:\"Limit number of Orders per slot and number of Items per Order.\";s:11:\"screenshots\";O:8:\"stdClass\":4:{s:12:\"screenshot_0\";s:68:\"//s3-us-west-2.amazonaws.com/freemius/plugins/6932/screenshots/0.png\";s:12:\"screenshot_1\";s:68:\"//s3-us-west-2.amazonaws.com/freemius/plugins/6932/screenshots/1.png\";s:12:\"screenshot_2\";s:68:\"//s3-us-west-2.amazonaws.com/freemius/plugins/6932/screenshots/2.png\";s:12:\"screenshot_3\";s:68:\"//s3-us-west-2.amazonaws.com/freemius/plugins/6932/screenshots/3.png\";}s:2:\"id\";s:4:\"1817\";s:7:\"updated\";s:19:\"2020-12-03 15:27:15\";s:7:\"created\";s:19:\"2020-09-19 10:26:14\";s:22:\"\0FS_Entity\0_is_updated\";b:0;}s:10:\"is_premium\";b:0;s:14:\"premium_suffix\";s:9:\"(Premium)\";s:7:\"is_live\";b:1;s:9:\"bundle_id\";N;s:17:\"bundle_public_key\";N;s:10:\"public_key\";s:32:\"pk_92a2f626663b9b237b2ae2417525a\";s:10:\"secret_key\";N;s:2:\"id\";s:4:\"6932\";s:7:\"updated\";s:19:\"2020-12-29 16:02:09\";s:7:\"created\";s:19:\"2020-09-19 10:02:01\";s:22:\"\0FS_Entity\0_is_updated\";b:0;}i:1;O:9:\"FS_Plugin\":23:{s