e is open.</li>\n<li>Set customized service timings, also its different for delivery and pickup.</li>\n<li>Set order limit for a particular slot. </li>\n<li>Set how many items can be ordered in a single order. </li>\n</ul>\n\n<p>With these kind of settings we are giving you complete free hand to play with your timings at will. Checkout our <a href=http://food-store.wpscripts.in/knowledge-base/category/premium-store-service-hours/\" target=\"_blank\">Knowledge Base</a> for more details and help with setup. </p>\";s:17:\"short_description\";s:131:\"With Store and Service hours premium extension, you will be getting tons of customizable options to manage your timings like a pro.\";s:10:\"banner_url\";s:61:\"//s3-us-west-2.amazonaws.com/freemius/plugins/6932/banner.png\";s:15:\"card_banner_url\";s:66:\"//s3-us-west-2.amazonaws.com/freemius/plugins/6932/card_banner.png\";s:15:\"selling_point_0\";s:72:\"Setup various service timings for Delivery and Pickup with cutoff times.\";s:15:\"selling_point_1\";s:64:\"Manage your service days with special opening days and holidays.\";s:15:\"selling_point_2\";s:62:\"Limit number of Orders per slot and number of Items per Order.\";s:11:\"screenshots\";O:8:\"stdClass\":4:{s:12:\"screenshot_0\";s:68:\"//s3-us-west-2.amazonaws.com/freemius/plugins/6932/screenshots/0.png\";s:12:\"screenshot_1\";s:68:\"//s3-us-west-2.amazonaws.com/freemius/plugins/6932/screenshots/1.png\";s:12:\"screenshot_2\";s:68:\"//s3-us-west-2.amazonaws.com/freemius/plugins/6932/screenshots/2.png\";s:12:\"screenshot_3\";s:68:\"//s3-us-west-2.amazonaws.com/freemius/plugins/6932/screenshots/3.png\";}s:2:\"id\";s:4:\"1817\";s:7:\"created\";s:19:\"2020-09-19 10:26:14\";s:7:\"updated\";s:19:\"2020-12-03 15:27:15\";}s:12:\"premium_slug\";s:27:\"store-service-hours-premium\";}i:1;O:8:\"stdClass\":32:{s:16:\"parent_plugin_id\";s:4:\"6737\";s:12:\"developer_id\";s:4:\"9189\";s:10:\"install_id\";s:7:\"5586284\";s:4:\"slug\";s:10:\"essentials\";s:5:\"title\";s:10:\"Essentials\"